import axios from "axios";
import {useLocation, useNavigate} from 'react-router-dom';
import { Form, Button } from "react-bootstrap";
export default function ReplyQuery() {
    const location = useLocation();
    const [users, setUsers] = useState([]);

  useEffect(() => {
    loadUsers();
  }, []);

  const loadUsers = async () => {
        console.log("hello");
       // console.log(location.state.id.id.id);
    try {
        const id=location.state.id.id.id;
        console.log();
        const url = `http://localhost:8081/api/admin/quries`;
      const result = await axios.get(url, { headers: {"Authorization" : `Bearer ${location.state.id.id.token}`} })
      console.log("hello");
      setUsers(result.data);
    } catch (error) {
   console.error(error);
    }
  }

  return (
    <div className='container'>
        <div className='py-4'>
            <table className='table border shadow'>
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <></>
                        <th scope="col">Subject</th>
                        <th scope="col">Query</th>
                        <th scope="col">Action</th>
                        <th scope="col">Action</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        users.map((user,index)=>(

                            <tr>
                                <th scope="row" key={index}>{index+1}</th>

                                <td>{user.subject}</td>
                                <td>{user.queryText}</td>
                                <td>
                  <Button
                    className="btn btn-danger btn-lg btn-block"
                    onClick={() => cancel(user.id)}
                  >
                    Cancel Appointment
                  </Button>
                </td>
                            </tr>

                        ))
                    }
                </tbody>
            </table>
        </div>
    </div>

  )
}
